import React from 'react';
import Nav from '../components/Navbar';

const About = () => {
  return (
    <div>
      <Navbar />
      <section>
        <h2>About Me</h2>
        <p>
          I'm a full-stack web developer with a passion for creating interactive and responsive websites.
          I have experience in HTML, CSS, JavaScript, React, Node.js, and more.
        </p>
      </section>
    </div>
  );
};

export default About;
